import React, { useState } from "react";
import { Link } from "react-router-dom";
import { useAuth } from "./context/AuthContext.jsx";
import { Menu, X } from "lucide-react";
import "../styles/Header.css";

const Header = ({ hideLoginButton, hideRegisterButton }) => {
  const { isAuthenticated, logout } = useAuth();
  const [menuOpen, setMenuOpen] = useState(false);

  return (
    <header className="header">
      <div className="logo-container">
        <h1 className="logo">FisioHome</h1>
        <button className="menu-button" onClick={() => setMenuOpen(!menuOpen)}>
          {menuOpen ? <X size={24} /> : <Menu size={24} />}
        </button>
      </div>
      <nav className={`nav ${menuOpen ? "open" : ""}`}>
        <Link to="/">Home</Link>
        <Link to="/find-a-therapist">Find a Therapist</Link>
        <Link to="/my-concerns">My Concerns</Link>
        <Link to="/about-us">About Us</Link>
        <Link to="/contact-us">Contact Us</Link>
        {!isAuthenticated && !hideRegisterButton && (
          <Link to="/register" className="nav-link">Register</Link>
        )}
      </nav>
      <div className="auth-links">
        {!isAuthenticated ? (
          !hideLoginButton && (
            <Link to="/login" className="auth-button primary">Login</Link>
          )
        ) : (
          <button onClick={logout} className="auth-button secondary">Logout</button>
        )}
      </div>
    </header>
  );
};

export default Header;
